import React from "react";
import "./About.css";
import styled from 'styled-components'
import { SiTypescript, SiJavascript, SiHtml5, SiCss3, SiReact, SiGit, SiStyledcomponents, SiSass, SiPostgresql, SiHeroku } from 'react-icons/si';
import { DiSass } from 'react-icons/di'

const AboutGrid = styled('div')({
    display: 'grid',
    gridTemplateColumns: 'repeat(2, 1fr)',
    gridTemplateRows: 'repeat(1, 1fr)',
});

const DivCol = styled('div')({
    display: 'flex',
    flexDirection: 'column',
    minWidth: '0px',
    width: '100%',
    height: '100%',
  });

function About() {
  return (
    <div className="about">
        <body>
      <h1>About me</h1>
      <p style={{ paddingTop: "55px" }}>
        Full stack developer. From Michigan,
        based in Tennessee.
      </p>
      <AboutGrid>
      <DivCol style={{gridColumn: '1', gridRow: '1'}}>
      <h2 style={{paddingTop: '25px'}}>Experience</h2>
      <p style={{paddingTop: '10px'}}>Joint Special Operations Command</p>
      <p style={{color: 'rgb(81, 193, 241)'}}>current</p>
      </DivCol>
      <DivCol style={{gridColumn: '2', gridRow: '1'}}>
      <h2 style={{paddingTop: '25px'}}>Education</h2>
      <p style={{paddingTop: '10px'}}>Galvanize SDI</p>
      <p style={{paddingTop: '10px'}}>Universty of Penn State 2022-2026</p>
      </DivCol>
      <div>
        <h2 style={{textAlign: 'center'}}>Skills</h2>
      <p class="marquee" >
  <span style={{fontSize: '50px'}}><SiJavascript style={{marginRight:'10%'}}/><SiHeroku style={{marginRight:'10'}}/><SiStyledcomponents style={{marginRight:'10%'}}/><i class="fab fa-golang"/><SiTypescript style={{marginRight:'10%'}}/><SiHtml5 style={{marginRight:'10%'}}/><SiCss3 style={{marginRight:'10%'}}/><DiSass style={{marginRight:'10%'}}/><SiReact style={{marginRight:'10%'}}/><SiGit style={{marginRight:'10%'}}/>&nbsp;</span>;
</p>
<p class="marquee marquee2">
  <span style={{fontSize: '50px', marginRight: '100%'}}><SiJavascript style={{marginRight:'10%'}}/><SiHeroku style={{marginRight:'10%'}}/><SiStyledcomponents style={{marginRight:'10%'}}/><i class="fab fa-golang"/><SiTypescript style={{marginRight:'10%'}}/><SiHtml5 style={{marginRight:'10%'}}/><SiCss3 style={{marginRight:'10%'}}/><DiSass style={{marginRight:'10%'}}/><SiReact style={{marginRight:'10%'}}/><SiGit style={{marginRight:'10%'}}/>&nbsp;</span>;
</p>
</div>
      </AboutGrid>
      </body>
    </div>
  );
}

export default About;
